A simple JavaBean to represent label-value pairs. This is most commonly used when constructing user interface elements which have a label to be displayed to the user, and a corresponding value to be returned to the server. One example is the <code>&lt;html:options&gt;</code> tag. 
<p>Note: this class has a natural ordering that is inconsistent with equals. 
@see org.apache.struts.util.LabelValueBean

UML:Expression.body:
new Comparator() {
        public int compare(Object o1, Object o2) {
            String label1 = ((LabelValue) o1).getLabel();
            String label2 = ((LabelValue) o2).getLabel();
            return label1.compareToIgnoreCase(label2);
        }
    }

